import React from "react";
import { useState } from "react";

const ArrayState = () => {
  const [todoos, setTodoos] = useState([]);

  const handleAddToodo = (e) => {
    setTodoos([...todoos, "New Todo"]);
  };
  return (
    <div>
      <ul>
        <li>{todoos}</li>
      </ul>
      <button>
        <div className="btn btn-primary">Add Todo</div>
      </button>
    </div>
  );
};

export default ArrayState;
